import React from "react";
import ListOfSongs from "../Common/ListOfSongs";

const SongsList = () => {
  return (
    <div>
      {ListOfSongs.map((item) => (
        <div>
          <div>{item.Name}</div>
          <div>{item.Duration}</div>
        </div>
      ))}
    </div>
  );
};
export default SongsList;
